import rna

def protein(l):
	x = l[0:3]
	min = 3
	max = 6
	y = rna.codon(x)
	while(max <= len(l)):
		x = l[min:max]
		y += rna.codon(x)
		min+=3
		max+=3
	return y

dna = ""
peptide = "FQFLSKEHYR"
k = len(peptide)
for i in range(len(dna)-3*k+1):
	p = protein(rna.transcribe(dna[i:i+3*k]))
	if p == peptide:
		print(dna[i:i+3*k])
	p = protein(rna.reverseTranscribe(dna[i:i+3*k]))
	if p == peptide:
		print(dna[i:i+3*k])
